text:
Congress passed the HALT Fentanyl Act, sending it on to President Trump for his signature. 

The bill permanently classifies chemically altered fentanyl substances as Schedule I drugs, cracking down on drug traffickers and securing the highest penalty for all altered fentanyl substances. 

Deadly fentanyl poisoning has claimed far too many lives in Kentucky and across the country. In fact, over 62% of all overdose deaths in the Commonwealth were a result of fentanyl poisoning in 2024, according to the Kentucky Office of Drug Control Policy. 
@POTUS 
@kyodcp 

Read more about it here: https://t.co/PNluf7V1la

This morning, I asked U.S. Transportation Secretary Sean Duffy about his plans to enhance rural road systems and rural airports as we develop federal funding bills for fiscal year 2026. 

Only 20% of Americans live in rural areas, but they accounted for 43% of all roadway deaths from 2017-2021 with over 83,000 fatalities. We need to focus on increasing safety on our rural roads and ensuring our rural airports have the resources necessary for operating in rural communities.

@HouseAppropsGOP
